import React, { useEffect, useState, useContext } from 'react'

import axios from 'axios'
import { Context } from '../pages/Store'

const Blog = () => {
  const [state, dispatch] = useContext(Context)
  const [data, setData] = useState({ hits: [] })
  /* 
  useEffect(() => {
    axios
      .get('https://ws.med.tn/web/doctorInfos/?api_key=drmateri')
      .then(response => {
        console.log('88888888888', Object.values(response.data))
        dispatch({
          type: 'SET_POSTS',
          payload: Object.values(response.data[0]),
        })
      })
      .catch(error => {
        dispatch({ type: 'SET_ERROR', payload: error })
      })
  }, []) */

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios(
        'https://ws.med.tn/web/doctorInfos/?api_key=drmateri'
      )

      console.log('ooooooooo', result.data)
      setData(result.data)
      dispatch({
        type: 'SET_POSTS',
        payload: data,
      })
    }
    fetchData()
  }, [])

  let posts = <p>Loading...</p>

  if (state.error) {
    posts = (
      <p>
        Something went wrong: <span>{state.error}</span>
      </p>
    )
  }

  if (!state.error && state.posts) {
    console.log('posts', state.posts)
    return <a>{state.posts}</a>
  }
  return { posts }
}

export default Blog
